package HashingTutorial;

import java.util.*;

public class ValidAnagram {
    public static void main(String[] args) {
        String s = "";
        String t = "";
        Boolean answer = isAnagram(s,t);
        System.out.println(answer);
    }

    static boolean isAnagram(String s, String t) {
        HashMap<String, Integer> map1 = new HashMap<>();
        HashMap<String, Integer> map2 = new HashMap<>();

        for (int i = 0; i < s.length(); i++) {
            if (!map1.containsKey(s.substring(i, i + 1))) {
                map1.put(s.substring(i, i + 1), 1);
            } else {
                map1.put(s.substring(i, i + 1), map1.get(s.substring(i, i + 1)) + 1);
            }
        }

        for (int i = 0; i < t.length(); i++) {
            if (!map2.containsKey(t.substring(i, i + 1))) {
                map2.put(t.substring(i, i + 1), 1);
            } else {
                map2.put(t.substring(i, i + 1), map2.get(t.substring(i, i + 1)) + 1);
            }
        }

        if (map1.size() != map2.size()) {
            return false;
        }

        for (Map.Entry<String, Integer> set1 : map1.entrySet()) {
            if (map2.containsKey(set1.getKey()) && Objects.equals(map2.get(set1.getKey()), set1.getValue())) {
                map2.remove(set1.getKey());
            }

        }

        if (map2.isEmpty()) {
            return true;
        }
        return false;
    }
}
